import { Header }  from '../../components/Header/Header.js';
import Box from '@mui/material/Box';

export const Home = () => {

    return (
        <Box>
            <Header />
            <Box sx={{ display: 'flex' }}>
                <svg>
                    <img src={'../../assets/images/home.svg'} alt='homeImage' width="500px" height="500px"/>
                </svg>

            </Box>
        </Box>

    )
}
